import './css/CertFile.css';

function AlertBox(props){
    return(
      <div className="certFileContainer">
      <div className="certFileBox">
        <h2>{props.certFileStudnet["name"]}</h2>
        <br/>
        {props.student}
        <img src= {`https://codingapple1.github.io/shop/shoes2.jpg`} width={"300px"} height={"400px"} alt=""/>
        <p>{props.certFileStudnet["name"]}</p>
        <p>{props.certFileStudnet["stdID"]}</p>
        <div className="certFileBtns">
        <button className="errorBtn" onClick={()=>{props.setCertFile(false)}}>나가기</button>
        </div>
      </div>
    </div>
    )

  }

export default AlertBox;
